import "./messagecard.css";
import React, { useEffect } from "react";

const MessageCard = (id, name, classification, matchimage, courses) => {
    return (
        <div className="messageCardBox">
            <div className="messageCardImage">
                <img src={matchimage} />
            </div>
            <div className="messageCardName">
                {name}
            </div>
            <div className="messageCardClass">
                {classification}
            </div>
            <div className="messageCardCourses">
                {courses}
            </div>
        </div>
    );
}

export default MessageCard;
